import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import ImageCard from '../ImageCard';
import Choose from '../Choose';


function Home() {
  return (
    <>
      <HeroSection />
      <ImageCard/>
      <Choose/>
    </>
  );
}

export default Home;
